import React from 'react'
import ReactDom from 'react-dom'

const App = () =>  (
  <div className='container'>
    <div>
      <h1>Number List
      </h1>
      {[1, 2, 3, 4, 5]}

    </div>
  </div>
)

const rootElement = document.getElementById('root')

ReactDom.render(<App />, rootElement)
